import React from 'react';

export default function ProductScreen (){
    return (<div>
        <div className="logo-section">
            <div id="logo">
                <a href="https://www.shadkothan.com"> <img className="logo" src="images/ShadKothon_Logo.jpg" alt="Logo" /></a>
            </div>
          </div>
    </div>)
    ;
}
